import Link from 'next/link';
import Navegacion from '../componenets/Navegacion';

const index = () =>{
    return(
        <div>
            <ul>
                <li>
                    <Link href="/">
                        <a className="">Inicio</a>
                    </Link>
                </li>
                <li>
                    <Link href="/nosotros">
                        <a className="">Nosotros</a>
                    </Link>
                </li>
            </ul>
            <p>Hola Mundo</p>
        </div>
    )
}

export default index;
